//       setIdeas(data);
//     }
//   )
// }, [])

  console.log(ideas, ' line25')
  return (
    <div className="App">
      <h1>
        <FormComponent formValues={formValues} setFormVals={setFormVals} addIdea={addIdea(emptyFormVals)} />
      </h1>
      <h2>
        <ExternalComponent ideas={ideas} setIdeas={setIdeas} />
      </h2>
    </div>
  );
}

export default App;
